import React, { Component } from "react";
import { Error } from "./Error";
import { postRegister } from "../../services/ApiDatings";

export class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.dni = "";
    this.name = "";
    this.lastName = "";
    this.phone = "";
    /* this.history = ""; */
  }

  async submitRegister(e) {
    e.preventDefault();
    let register = await postRegister(
      this.dni,
      this.name,
      this.lastName,
      this.phone
    );
  }

  handlerDni(e) {
    this.dni = e.target.value;
  }

  handlerName(e) {
    this.name = e.target.value;
  }

  handleLastName(e) {
    this.lastName = e.target.value;
  }

  handlerPhone(e) {
    this.dni = e.target.value;
  }

  /*handleHistory(e) {
    this.history = e.target.value;
  }
  */

  render() {
    return (
      <div className='wrapper fadeInDown'>
        {this.state.error && <Error msg='Credenciales incorrectas' />}
        {this.state.logged && (
          <Error msg='Credenciales correctas, ¡estás logado!' />
        )}

        <div className='formContent'>
          <h2>Sing In</h2>
          <div className='fadeIn first'>
            <img src='' className='icon' />
          </div>

          <form>
            <input type='text' onInput={e => this.handlerDni(e)} />
            <input type='text' onInput={e => this.handlerName(e)} />
            <input type='text' onInput={e => this.handleLastName(e)} />
            <input type='text' onInput={e => this.handlerPhone(e)} />
            <br></br>
            <button onClick={e => this.submitRegister(e)}>Register</button>
          </form>
          <br></br>
        </div>
      </div>
    );
  }
}
